module.exports = "<div class=\"back\">\n  <body class =\"body\">\n<!-- Add some html here if making the Esri map smaller via your esri-map.component.css-->\n\n    <!-- Import the following into the app component, passing props from the child map component to the the parent component here -->\n    <div class =\"map\">\n      <app-esri-map\n        [center]=\"mapCenter\"\n        [basemap]=\"basemapType\"\n        [zoom]=\"mapZoomLevel\"\n        (mapLoaded)=\"mapLoadedEvent($event)\">\n      </app-esri-map>\n    </div><!--.map-->\n\n    <h1 class=\"title\">\n      Coastal Map of Southern San Diego, California\n    </h1><!--.title-->\n\n    <div class =\"ftext paragraph\">\n      <b><u>Instructions</u>:</b> Use the interactive map below to explore the coast of southern San Diego. Feel free to use this as a tool for public outreach, education or environmental planning. To navigate, use your mouse to pan, your scroll wheel to zoom in/out and click on the features to view their information. Clicking on the features brings up a pop up with the options of zooming to the feature, going to the next feature (in case of overlapping/clustered features) and docking the pop up window.\n      <p class =\"paragraph\"> \n        <b><u>Widgets</u>:</b> The zoom buttons are located on the top left corner of the map. Below those buttons is the geolocation button with the crosshairs icon. Use this to zoom into your current location (you may have to give permission to your browser). The home button below that can be used to go to the full extent of southern San Diego. \n      <p class =\"tab\">\n        Right below that is the Legend/Table of Contents, where you can toggle the visibility of each layer. On the bottom right are the dynamic scale bar and the “New Measurement” widget. This measurement widget can be used to measure the straight distance between two or more points. After completing the measurement, the units can be modified using the widget’s drop down button.\n      </p><!--.paragraph-->\n      <p class =\"tab\">\n        On the top right is the “Coordinate Conversion” widget, which displays your cursor position as coordinates and allows you to convert between different coordinate notations. This widget also allows you to input/zoom to specific coordinates, toggle between live (default)/capture mode and adjust its settings. Right below that is the search widget, which is a search cursor that accepts addresses and zooms to them. The next widgets is the Basemap Toggle, that is used for switching between the “satellite” basemap and the sharp/lighter-colored “topo-vector” basemap. Finally, I’ve added a compass widget to serve as a north arrow for the map.\n      </p><!--.paragraph-->\n      <p class =\"paragraph\">\n        <b><u>Data Sources</u>:</b> \n          <ol>\n            <li>\n              California State Lands Commission, Various ArcGIS Feature Services [REST services]. 2019. https://services3.arcgis.com/5aaQCuq3e4GRvkFG/arcgis/rest/services/. (10/26/2019). Using: ArcGIS [GIS software]. Version 10.7.\n            </li>\n            <li>\n              California Natural Resources Agency, Various ArcGIS Map Services [REST services]. Various dates (some prior to 2019). https://gis.cnra.ca.gov/arcgis/rest/services. (10/26/2019). Using: ArcGIS [GIS software]. Version 10.3.\n            </li>\n          </ol> \n      <p class =\"paragraph\">\n        <b><u>Application Programming Interface (API)</u>:</b> \n        <ul>\n          <li>\n            ArcGIS API for JavaScript, version 4.13. <a href colored=\"https://developers.arcgis.com/javascript\">https://developers.arcgis.com/javascript</a>. 2019.\n          </li>\n        </ul>\n\n    </div><!--.ftext, .paragraph-->\n  </body> <!--.body-->\n</div> <!--.back-->\n"

